new class{constructor(){this.imageThumbs=document.querySelectorAll(".js-imageThumb"),this.changeTalentImage()}changeTalentImage(){const e=document.querySelector(".js-imageItem");this.imageThumbs.forEach((t=>{t.addEventListener("click",(function(){const t=this.querySelector(".js-imageMain").textContent;e.querySelector("img").setAttribute("src",t)}))}))}};